import React from "react";
import { useFormik } from "formik";
import { render } from "react-dom";


const initialValues = {
  nomeInstituicao: "",
  telefoneInstituicao: "",
  emailInstituicao: "",
  nomeResponsavel: "",
  telefoneResponsavel: "",
  emailResponsavel: "",
  nVisitantes: "",
  dataVisita: "",
  objetivoCaract: "",
  horario: "",
  opcoes: ""

};

const MyForm = () => {
  const onSubmit = values => { };

  const formik = useFormik({
    initialValues,
    onSubmit
  });

  return (
    <form>
      <div>
        <input placeholder="Instituição visitante" />
        <input placeholder="Telefone da Isntituição" />
        <input placeholder="E-mail da intituição" />
      </div>

      <div>
        <input placeholder="Nome do Responsável" />
        <input placeholder="Telefone do responsável" />
        <input placeholder="E-mail do responsável" />
      </div>

    </form>
  );
};

render(<MyForm />, document.getElementById("root"));
